import React,{useState} from 'react'

const Handleinput = () => {
   const [name,setName] =useState({firstname:"",lastname:""})
  return (
    <div>
      <form>
        <label>First Name:</label>
        <input type="text" onChange={(e)=>setName(...name,firstName)} value={name.firstName}></input><br>
        </br>
        <label>Last Name:</label>
        <input type="text" value={name.lastName}></input>
      </form>
    </div>
  )
}

export default Handleinput
